import React from 'react';


interface OwnProps {
    handleOnSubmit,
    newName,
    handleOnNameChange,
    newNumber,
    handleOnNumberChange,
  }

  type Props = OwnProps; 


const PersonForm = ({handleOnSubmit,newName,handleOnNameChange,newNumber,
  handleOnNumberChange,

}) => {
  return (
    <form onSubmit={handleOnSubmit}>
      <div>
        name:
        <input 
          value={newName}
          onChange={handleOnNameChange}
        />
      </div>
      <div>
        number:
        <input
          value={newNumber}
          onChange={handleOnNumberChange}
        />
      </div>
      <div>
        <button type='submit'>add</button>
      </div>
    </form>
  );
};

export default PersonForm;
